            clauses.append(f"The cost of {subject} was {triple.object}")
        elif triple.predicate == "floorArea":
            clauses.append(f"{subject} has a floor area of {triple.object}")
        elif triple.predicate == "owner":
            clauses.append(f"{subject} is owned by {triple.object}")
        elif triple.predicate == "formerName":
            clauses.append(f"{subject} was formerly known as {triple.object}")
        elif triple.predicate == "height":
            clauses.append(f"The height of {subject} is {triple.object} meters")
        elif triple.predicate == "buildingType":
            clauses.append(f"{subject} is a {triple.object}")
        elif triple.predicate == "developer":
            clauses.append(f"{subject} was developed by {triple.object}")
        elif triple.predicate == "tenant":
            clauses.append(f"{subject}'s tenant is {triple.object}")
        elif triple.predicate == "isPartOf":
            clauses.append(f"{subject} is part of {triple.object}")
        elif triple.predicate == "country":
            clauses.append(f"{subject} is in {triple.object}")
        elif triple.predicate == "currentTenants":
            clauses.append(f"The current tenants of {subject} are {triple.object}")
        elif triple.predicate == "address":
            clauses.append(f"The address of {subject} is {triple.object}")
